import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme)=>({
    aboutPage:{
        width:"100%",
        position:'absolute',
        top:900,

        backgroundColor:'#FFF0DB',
        height: "1000px",
    },
    profileImg:{
        position:'absolute',
        height: 400,
        width:400,
        maxHeight: 400,
        maxWidth:400,
        top:"10%"

    }

}));

export default useStyles;
